import React, {useState, useEffect} from 'react'
import {API_URL} from "./API";
import axios from "axios";
import { useNavigate } from 'react-router-dom';



const Tester = () => {
  const [books, setBooks] = useState([]);

  const navigate = useNavigate();

  useEffect(() => {
    axios 
      .get(API_URL)
      .then((res) => {
        console.log(res.data);
        setBooks(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div>
        <div className="holder">
    <div>
    <h2 className="side_bar">Category</h2>
    <div className="label_container">
      <label className="sidebar_label_container">
        <span className="checkmark">Horror</span>
      </label>
      <label className="sidebar_label_container">
        <input type="radio" name="test" />
        <span className="checkmark">Fantasy</span>
      </label>
      <label className="sidebar_label_container">
        <input type="radio" name="test" />
        <span className="checkmark">Non-Fiction</span>
      </label>
      <label className="sidebar_label_container">
        <input type="radio" name="test" />
        <span className="checkmark">History</span>
      </label>
      <label className="sidebar_label_container">
        <input type="radio" name="test" />
        <span className="checkmark">Comedy</span>
      </label>
    </div>
  </div>
</div>




    </div>
  )
}

export default Tester
